import React from 'react';
import '../index.css';
import { createUseStyles } from 'react-jss';
import colors from '../globals/colors.js';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

const linkList = [
    {
        name: "GitHub",
        link: "https://github.com/jkovalikhaas",
        icon: "github-icon-white.png"
    },
    {
        name: "LinkedIn",
        link: "https://www.linkedin.com/in/joseph-kovalik-haas-29a615150/",
        icon: "linkedn-logo.png"
    },
    {
        name: "Fancy Tile Puzzle",
        link: "https://apps.apple.com/us/app/fancy-tile-puzzle/id1462511327",
        icon: 'ftp-icon.jpg'
    }
];

const useStyles = createUseStyles({
    content: {
        margin: '60px auto'
    },
    grid: {

    },
    tile: {
        width: '400px',
        height: '400px'
    },
    tileIcon: {
        padding: '20px'
    }
});

export const HomeGrid = () => {
    const styles = useStyles();

    return (
        <div className={styles.content}>
            <GridList cols={3}>
            {linkList.map((x, i) => {
                return (
                    <GridListTile key={x.icon} className={styles.grid}>
                        <a className={styles.tile} target={"_blank"} href={x.link}>
                            <img src='../assets/images/github-icon-black.png' />
                        </a>
                    </GridListTile>
                )
            })}
            </GridList>
        </div>
    )
};

export default HomeGrid;
